  const [num, setNum] = useState(0);

  useEffect(() => {
    alert("I am Clicked");
  });

  return (
    <>
      <button
        onClick={() => {
          setNum(num + 1);
        }}
      >
        Click me {num}
      </button>
      <button
        onClick={() => {
          setNum(num + 1);
